import './App.css';
import NavBar from './components/NavBar'
import MainContent from './components/MainContent'

function App() {
  return (
    <div className="App">
      <div className="Content">
        <div className="Navbar">
          <Navbar />
        </div>
        <div className="MainContent">
          <MainContent />
        </div>
      </div>
    </div>
  );
}

export default App;
